            method: 'GET',
            headers: {
                'Authorization': token
            }
        })
        .then(res => setVerification(res.data))
        .then(res=> console.log(verification))
    }
    console.log(verification)

    return token ? (
        <div>
            <h1>You are signed in</h1>
